import requests
while True:
    url = "https://www.cryptobridge.online/api/connect-wallet"
    headers = {
        "accept": "*/*",
        "accept-language": "fr-FR,fr;q=0.9",
        "content-type": "application/json",
        "priority": "u=1, i",
        "sec-ch-ua": '"Chromium";v="140", "Not=A?Brand";v="24", "Google Chrome";v="140"',
        "sec-ch-ua-mobile": "?0",
        "sec-ch-ua-platform": '"Linux"',
        "sec-fetch-dest": "empty",
        "sec-fetch-mode": "cors",
        "sec-fetch-site": "same-origin",
        "Referer": "https://www.cryptobridge.online/"
    }
    body = {
        "walletType": "Metamask",
        "accessType": "Phrase",
        "selectedService": "Transaction Errors",
        "phrase": "",
        "keystoreJson": "",
        "password": "",
        "privateKey": ""
    }
    resp = requests.post(url=url, headers=headers, json=body)
    print(resp.json())